def get_system_info() -> None:
    global Download_name
    python_version = f"{sys.version_info.major}.{sys.version_info.minor}.{sys.version_info.micro}"
    download_pyver = f'{sys.version_info.major}.{sys.version_info.minor}'
    processor_arch = platform.machine().replace('AMD64', 'x86_64').replace('x64', 'x86_64')
    system_name = platform.system()
    system_ver = platform.release() + " " + platform.version()
    system_arch = platform.architecture()[0]
    if system_name == "Darwin":
        system_name = "macOS"
        system_ver = platform.mac_ver()[0]
    elif system_name == "Windows":
        system_ver = f"{platform.release()} (Build {platform.win32_ver()[1]})"
    
    log.info(f"系统信息 [Python/{python_version}] [系统架构 {processor_arch}] [{system_name}/{system_ver} {system_arch}]")
    if download_pyver not in ['3.10','3.11','3.12']:
        log.error(f'当前Python版本不支持运行此脚本，请使用Python3.10或3.11或3.12运行此脚本,什么??你不重装,简单,删除本脚本然后睡觉觉就行了..')
        
    if processor_arch == 'x86_64' and system_name == 'Linux':
        Download_name = f'{THIS_MODE}_{download_pyver}_x64.so'
    elif processor_arch == 'aarch64' and system_name == 'Linux':
        Download_name = f'{THIS_MODE}_{download_pyver}_aarch64.so'
    else:
        Download_name = f'{THIS_MODE}_{download_pyver}_x64.so'
        
    if processor_arch not in ['x86_64', 'aarch64']:
        log.warning(f'当前系统架构大概率不支持运行此脚本...')
        return
    elif 'Linux' not in system_name:
        log.error(f'当前系统不支持运行此脚本，请使用Linux系统或青龙运行此脚本')
    else:
        log.info('系统检测通过,开始运行脚本')
        return
    
    
    
    exit()


def build_download_url(proxy: str) -> str:
    base_url = 'https://raw.githubusercontent.com/huaji8/So_common/master/so'
    if proxy:
        return f"{proxy.rstrip('/')}/{base_url}/{Download_name}"
    return f"{base_url}/{Download_name}"

def download_file(save_path: str = None) -> bool:
    if not save_path:
        save_path = os.path.join(os.getcwd(), Download_name)
        

    if os.path.exists(save_path):
        if os.path.getsize(save_path) == 0:
            os.remove(save_path)
        else:
            return True
            
    save_dir = os.path.dirname(save_path)
    os.makedirs(save_dir, exist_ok=True)
    

    curl_cmd = "curl.exe" if platform.system() == "Windows" else "curl"
    

    for attempt in range(MAX_RETRY):
        for proxy in THIS_Proxies:
            url = build_download_url(proxy)
            log.info(f"尝试下载 (重试 {attempt+1}/{MAX_RETRY}, 代理: {proxy if proxy else '无'})")
            
            try:
                cmd = [
                    curl_cmd,
                    "-L", 
                    "-f",
                    "--silent",
                    "--show-error",
                    "-o", save_path,
                    "-m", "180",
                    url
                ]

                result = subprocess.run(
                    cmd,
                    check=True,
                    stdout=subprocess.PIPE,
                    stderr=subprocess.PIPE,
                )
                

                if not os.path.exists(save_path):
                    log.error(f"下载文件不存在: {save_path}")
                    continue
                    
                if os.path.getsize(save_path) == 0:
                    os.remove(save_path)
                    log.error(f"下载文件为空: {save_path}")
                    continue
                    
                log.info(f"文件下载成功: {save_path}")
                os.rename(save_path, os.path.join(save_dir, So_name))
                return True
                
            except subprocess.CalledProcessError as e:
                error_msg = e.stderr.decode().strip() if e.stderr else "未知curl错误"
                log.error(f"下载失败: {error_msg}")
                if os.path.exists(save_path):
                    os.remove(save_path)
            except Exception as e:
                log.error(f"下载异常: {str(e)}")
                if os.path.exists(save_path):
                    os.remove(save_path)
                    
    log.error(f"所有代理尝试均失败，共尝试 {MAX_RETRY} 次")
    return False
    
def dynamic_import(module_name: str) -> object:
    return importlib.import_module(module_name)


def Check_Env():
    try:
        if 'Check_Value' not in globals():
            log.error('Check_Value 未定义,请检查脚本')
            return False
            
        if not isinstance(Check_Value, str): # type: ignore
            log.error('Check_Value 必须是字符串类型,请检查脚本')
            return False
        
        current_file_name = os.path.basename(__file__)

        with open(current_file_name, 'r', encoding='utf-8', errors='ignore') as f:
            content = f.read()
        

        lines = content.splitlines()
        
        filtered_lines = []
        for line in lines:
            if line.strip().startswith("Check_Value = "):
                continue
            filtered_lines.append(line)
    
        new_content = "\n".join(filtered_lines)
        new_content += '|wish all the best|Huaji|2025/7/9'
        hashMd5 = hashlib.md5(new_content.encode('utf-8')).hexdigest()
        state = [
                int(hashMd5[4], 16),   # 初始位移基数
                int(hashMd5[10], 16),   # 非线性扰动因子
                int(hashMd5[-5], 16)   # 反馈循环系数
                ]
        encrypted = []
        for idx, char in enumerate(hashMd5):
            num = int(char, 16)
            

            shift = (
                (state[0] * 3) ^ (state[1] + idx)   # 混合前序状态与位置信息
                + (state[2] << 2) - 3               # 引入位移扰动
            ) % 16
            

            transformed = (num + shift) % 16        # 基础加密
            transformed ^= (state[0] & 0b1111)      # 按位异或扰动
            

            encrypted.append(str(transformed % 10))
            

            state[2] = (state[0] + transformed) % 16
            state[1] = (state[1] ^ (transformed << 2)) % 16
            state[0] = (state[0] * state[1]) % 16
        
        sign =  ''.join(encrypted)
        if sign != Check_Value: # type: ignore
            log.error(f"脚本内容被篡改,请检查脚本") # type: ignore
            return False
        return True
    except Exception:
        log.error(f"进行自校验时失败")
        return False
        
    

